// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AuthPage from './components/AuthLogin_Register/AuthPage';
import LinkedInCallback from './components/AuthLogin_Register/LinkedInCallback';

function App() {
  return (
    <Router>
      <Routes>
        {/* Route for the OAuth callback */}
        <Route path="/linkedin" element={<LinkedInCallback />} />
        {/* Default route for the authentication page */}
        <Route path="/" element={<AuthPage />} />
      </Routes>
    </Router>
  );
}

export default App;
